import React from 'react';

interface FinalScreenProps {
  score: number;
  skillLevel: string;
  onRestartClick: () => void;
}

const FinalScreen: React.FC<FinalScreenProps> = ({ score, skillLevel, onRestartClick }) => {
  return (
    <div className="final-screen">
      <h1>Hai finito il quiz!</h1>
      <p>Il tuo punteggio è {score}</p>
      <p>Livello di abilità: {skillLevel}</p>
      <button onClick={onRestartClick}>Ricomincia il quiz</button>
    </div>
  );
};

export default FinalScreen;
